import Page from '../layouts/Page.js';
import React from 'react';




export default class  EmploymentPage  extends React.Component {
  render() {
    const links = [
      {
        to: 'edgreeStatistics',
        text: 'Statistics'
      },
      {
        to:"employerSection",
        text:"Employers"
      },
      {
        to:"careers",
        text:"Careers"
      },
      {
        to:"coopTable",
        text:"Coops"
      },
      {
        to:"employmentTable",
        text:"Employment"
      },
      {
        to:"employerMap",
        text:"Employer Map"
      },
    ];
    return (
      <Page title="Home" links={links}>
        <section id="degreesSection"> 
          <Employment/>
        </section>
        ...
      </Page>

  );
};
}
